import React from "react";
import { Routes, Route, Link } from "react-router-dom";
import Component from "./Component";
import Components from "./Components";
import CompTshirt from "./Comtshirt";
import CompJeans from "./Comjeans";
import CompShoes from "./Comshoes";

function Home() {
  return (
    <div className="home">
      <h2>Categoreies to cart</h2>

      <Component />

      <h2>Trending in Shirts</h2>

      <Components />

      <h2>Trendind in T-shirts</h2>

      <CompTshirt />

      <h2>Trendind in Jeans</h2>

      <CompJeans />

      <h2>Trendind in Shoes</h2>

      <CompShoes />
    </div>
  );
}

export default Home;
